<style>
:root{
  --bg:#0b1220; --bg2:#0f1830; --card:#121a2d; --ink:#eaf0ff; --muted:#9fb0d3;
  --accent:#6ea8ff; --accent2:#7cf2c4; --me:#1f2b46; --bot:#18223a;
  --radius:18px; --shadow:0 8px 30px rgba(0,0,0,.35);
}
*{box-sizing:border-box}
body{margin:0;background:linear-gradient(180deg,var(--bg),var(--bg2));color:var(--ink);
  font-family:system-ui,-apple-system,Segoe UI,Roboto,Tahoma,Arial;min-height:100dvh;display:flex;flex-direction:column}
.nav{position:sticky;top:0;z-index:3;background:linear-gradient(90deg,rgba(255,255,255,.03),rgba(255,255,255,0));
  border-bottom:1px solid rgba(255,255,255,.06);backdrop-filter:blur(6px)}
.wrap{max-width:980px;margin:auto;padding:14px 16px;display:flex;align-items:center;gap:12px}
.logo{width:40px;height:40px;border-radius:12px;overflow:hidden;box-shadow:var(--shadow);background:#0b1220}
.logo img{width:100%;height:100%;object-fit:cover;display:block}
.brand{font-weight:800;letter-spacing:.3px;font-size:20px}
.sub{color:var(--muted);font-size:13px;margin-inline-start:6px}
.app{max-width:980px;margin:10px auto 0;flex:1;display:flex;flex-direction:column;padding:0 12px}
.hero{margin:14px auto 0;background:linear-gradient(135deg,rgba(110,168,255,.25),rgba(124,242,196,.18));
  border:1px solid rgba(255,255,255,.08);border-radius:var(--radius);padding:14px 16px;box-shadow:var(--shadow)}
.chat{flex:1;overflow:auto;padding:18px;display:flex;flex-direction:column;gap:14px}
.bubble{max-width:78%;padding:12px 14px;border-radius:16px;line-height:1.65;box-shadow:var(--shadow);
  border:1px solid rgba(255,255,255,.06);word-wrap:break-word;white-space:pre-wrap}
.me{align-self:flex-end;background:var(--me)}
.bot{align-self:flex-start;background:var(--bot)}
.time{display:block;margin-top:6px;font-size:12px;color:var(--muted)}
.composer{position:sticky;bottom:0;z-index:2;background:linear-gradient(180deg,rgba(0,0,0,0),rgba(0,0,0,.4));
  padding:14px 12px;border-top:1px solid rgba(255,255,255,.08)}
.row{display:flex;gap:10px;background:var(--card);border-radius:16px;padding:10px;border:1px solid rgba(255,255,255,.06);box-shadow:var(--shadow)}
textarea{flex:1;background:transparent;border:none;outline:none;color:var(--ink);resize:none;max-height:160px;font-size:15px;line-height:1.6}
.btn{min-width:110px;border:none;border-radius:12px;padding:12px 16px;font-weight:600;
  background:linear-gradient(135deg,var(--accent),var(--accent2));cursor:pointer;color:#0b1220}
.btn:disabled{opacity:.6;cursor:not-allowed}
.typing{display:flex;align-items:center;gap:8px;color:var(--muted);font-size:14px;margin:0 18px 10px}
.dot{width:6px;height:6px;background:var(--muted);border-radius:50%;animation:blink 1.2s infinite}
.dot:nth-child(2){animation-delay:.2s} .dot:nth-child(3){animation-delay:.4s}
@keyframes blink{0%,80%,100%{opacity:.2}40%{opacity:1}}
.theme{display:flex;gap:8px;margin-left:auto}
.theme button{background:#0000;border:1px solid rgba(255,255,255,.15);color:var(--ink);
  border-radius:10px;padding:6px 10px;cursor:pointer}
a{color:var(--accent)}
</style>
</head>
